import React from "react";
import './projects.css'
import Carousal from "../Carousal/carousal";

export default function Projects() {
    
    return (
        <section id="projects">
        <div className="projects-heading">
          <span className="projects-heading-text">About Me!</span>
          <span className="projects-subheading">Brief Introduction</span>
        </div>
        <Carousal/>
        </section>
    )
}
